class Trie:
    def __init__(self):
        self.root = TrieNode()
        self.size = 0

    def insert(self, word: str) -> None:
        node = self.root
        for char in word:
            if char not in node.children:
                node.children[char] = TrieNode()
            node = node.children[char]
            node.is_word = True
            self.size += 1

    def max_matching(self) -> int:
        node = self.root
        max_matching = 0
        for char in node.children:
            if node.children[char].is_word:
                max_matching += 1
        return max_matching


