def solution(stdin: str) -> str:
    n, s = map(int, stdin.split())
    participants = {}
    for i in range(n):
        name, bet = stdin.split()
        participants[name] = participants.get(name, 0) + int(bet)
    participants = sorted(participants.items(), key=lambda x: x[1], reverse=True)
    winners = []
    for name, amount in participants:
        if amount == s:
            winners.append(name)
        elif amount >= s:
            winners.append(name)
            break
    return '\n'.join(winners)
